Features:
-List of newspapers in your country
-Change country
-Favorites
-Automatic syncing of newspapers and countries
-Swiping between favorite and newspaper lists
-Add newspapers
-Drag and drop sorting of favorites
-Translate webpage
-Set screen orientation
-Automatic cache delete
-Change textsize
-Show newspaper in fullscreen
-Share functionality
-Option to open newspapers in standard browser
-Option to enable zoom controls
-Choose to have keep screen on while reading
-Option to not load images
-Show/Hide bottom menu bar
-Move app to sd

